import React from "react";
import { TouchableOpacity, TextInput, View, Text } from "react-native";
import { Formik } from "formik";

const LoginScreen = () => {
  return (
    <View>
      <Text>Login</Text>
    </View>
  );
};

export default LoginScreen;
